import { auth } from '../firebase_config';
import Navbar from "./components/Navbar";
import Demande from "./components/Demande";
import React, { useState } from 'react';
import { doc, setDoc, getFirestore } from "firebase/firestore"; 

console.log(auth.currentUser)

function Accueilconnexion(props) {
    
    const [demande, setDemande]= useState(async () => {
        let d =[]
        const db = getFirestore();
        const users = collection(db, "requests");
        const q = await query(users, where("email2", "==", auth.currentUser.email));
        const querySnapshot = await getDocs(q);
        querySnapshot.forEach((doc) => {
            // doc.data() is never undefined for query doc snapshots
              d.push(doc.data())
          });
          console.log(d)
        return(d)
    });



    return (
        <div>
            <Navbar user={ this.props.user} username={ this.props.username } userchange={ this.props.userchange } userpic={ this.props.userpic } />
            <div class="container-fluid main">
                <div class="row">
                    <div class="col-lg-2 p-2 d-none d-lg-block">

                    </div>
                    <div class="col-lg-7 p-2 ps-mobile">

                    </div>
                    <div class="col-lg-3 p-2 d-none d-lg-block">
                        <div class="w-100 p-4">
                            <Demande demande={demande} />
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Accueilconnexion;
